import React from 'react'
import styled from 'styled-components'
import 'swiper/css';

import 'swiper/css/pagination';
const Visual = () => {
    return (
        <div>
            <StMainVideo>
                <StVideo autoPlay muted >
                    <source type='video/mp4' src="https://static.spartacodingclub.kr/media/main/main_m.mp4" />
                </StVideo>
            </StMainVideo>

        </div>

    )
}

export default Visual

const StMainVideo = styled.div`

    width: 100vw;
    height: 576px;
    position: absolute;
    top: 0;
    left: 0;
    z-index: -1;
`

const StVideo = styled.video`
   width: 100%;
   height: 100%;
   object-fit: cover
`
